import React from 'react';
import { HashRouter as Router, Route, Routes, Navigate } from "react-router-dom";

import Login from '../components/pages/Login';
import Signup from '../components/pages/Signup';
import AdminPage from "../components/pages/admin";
import HomePage from '../components/pages/HomePage';
import NewReservation from "../components/pages/newReservation/";
import Myreservations from "../components/pages/myBookings/";

import { Authprovider, AuthContext } from "../services/auth";

function AppRoutes() {
  const Private = ({ children }) => {
    const { authenticated, loading } = useContext(AuthContext);
    if (loading) {
      return <div className="loading">Carregando...</div>;
    }

    if (!authenticated) {
      return <Navigate to="/login" />;
    }
    return children;
  };

  return (
    <Router>
      <Authprovider>
        <Routes>
          <Route path='/login' element={<Login />} />
          <Route exact path='/homepage' element={<private> <HomePage /> </private>} />
          <Route path='/signup' element={<Signup />} />
          <Route path='/newreservationpage' element={<private> <NewReservation /> </private>} />
          <Route path='/myreservations' element={<private> <Myreservations /> </private>} />
          <Route path="/admin" element={<private> <AdminPage /> </private>} />
        </Routes>
      </Authprovider>
    </Router>
  );
}

export default AppRoutes;
